    public static StaplesSourceDto FromCsv(string csvLine)
    {
        try
        {
            string[] values = csvLine.Split(',');
            StaplesSourceDto blsc = new StaplesSourceDto();
            blsc.Id = Convert.ToInt32(values[0]);
            blsc.Phone = Convert.ToInt64(values[1]);
            blsc.Amount = Convert.ToDecimal(values[2]);
            blsc.Comment = Convert.ToString(values[3]);
            blsc.OrderNumber = Convert.ToInt64(values[4]);
            blsc.RebateType = Convert.ToString(values[5]);
            blsc.Product = Convert.ToString(values[6]);
            blsc.Rec = Convert.ToString(values[7]);
            blsc.Imei = Convert.ToString(values[8]);
            blsc.TransactionDate = Convert.ToDateTime(values[9]);
            blsc.SalesPerson = Convert.ToString(values[10]);
            blsc.CustomerName = Convert.ToString(values[11]);
            blsc.TaxCode = Convert.ToInt64(values[12]);
            blsc.Msf = Convert.ToString(values[13]);
            blsc.DeviceCo = Convert.ToString(values[14]);
            blsc.Location = Convert.ToString(values[15]);
            blsc.Brand = Convert.ToString(values[16]);
            blsc.Lob = Convert.ToString(values[17]);
            blsc.SubLob = Convert.ToString(values[18]);
            Console.WriteLine(blsc.Id);
            return blsc;
        }
        catch (Exception ex)
        {
            throw;
        }
    }
